import styled from 'styled-components';

const Container = styled.div`
	display: flex;
	margin: 1rem;
`;
const Ark = styled.div`
	display: flex;
	flex-direction: column;
`;
const Avalon = styled.div`
	display: flex;
	flex-direction: column;
`;
const Customer = styled.div`
	display: flex;
	flex-direction: column;
`;

export { Container, Ark, Avalon, Customer };
